export const clint = require("../assets/images/clint.png");
export const laweyer = require("../assets/images/laweyer.png");

export default {
    beach,
    climbingHills,
    frozenHills,
    homeBanner,
    onboardingImage,
    skiVilla,
    skiVillaBanner,
    homeScreen,
    mainScreen,
    laweyer,
    clint,
}
